import React from 'react';
import './Login.css';
import Header from "./Header.js";
import TextField from '@material-ui/core/TextField';
// import { makeStyles } from '@material-ui/core/styles';


class Login extends React.Component {
  goHome = () => {
    this.props.history.push("/");
  }

  goLogin = () => {
    this.props.history.push("/login");
  }

  goSignUp = () => {
    this.props.history.push("/registration");
  }
  render() {
    return(
      <div className="login">
        <Header goToHome={this.goHome} goToLogin={this.goLogin} goToSignUp={this.goSignUp} page={"home"}/>
        <div className="background"/>
        <div className="white-container">
          <div className="welcome-back">welcome back</div>
          <form className="login-form" noValidate autoComplete="off">
            <div>
              <TextField required id="standard-required" label="username" />
            </div>
            <div>
              <TextField required id="standard-password-input" type="password" label="password" />
            </div>
        </form>
          <div>username</div>
          <div>password</div>
          <div>login</div>
        </div>
      </div>
    );
  }
}

export default Login;
